import { Redirect, Route } from "react-router-dom";

type Iprops = {
  component: any;
  path: any;
};

export const PrivateRouter = (props: Iprops) => {
  let loginAccess = localStorage.getItem("token");
  let link = localStorage.getItem("_link_")
    ? localStorage.getItem("_link_")
    : null;

  const deleteToken = () => {
    localStorage.removeItem("_link_");
  };

  return <Route path={props.path} component={props.component}></Route>;
};

export const PublicRouter = (props: Iprops) => {
  return <Route path={props.path} component={props.component}></Route>;
};
